import {styled} from "styled-components";

export const TransactionContainer = styled.div`
	border-radius: 20px;
	display: block;
	overflow: visible;
	padding: 24px;
	position: relative;
	background-color: rgb(255, 255, 255);
	border: 1px solid rgb(230, 230, 230);
	width: 80%;	
	// text-align: center;
	margin: 0 auto;
`

export const HeaderContainer = styled.div`
	font-weight: bold;
`
